-- ----------------------------
-- Table structure for `facilities`
-- ----------------------------
DROP TABLE IF EXISTS `facilities`;
CREATE TABLE `facilities` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `facility_type_id` int(10) unsigned NOT NULL,
  `display_name` varchar(255) NOT NULL COMMENT 'The full, actual name (ie: "The Northwoods School")',
  `select_name` varchar(255) NOT NULL COMMENT 'A shortened name without any leading or preceeding preposition. Used for sorting alphabetically. (ie: "Northwoods School, the")',
  `active` enum('yes','no') NOT NULL DEFAULT 'yes',
  `date_added` datetime NOT NULL,
  `last_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `last_modified_by` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `facility_type_id` (`facility_type_id`),
  KEY `name` (`display_name`),
  KEY `select_name` (`select_name`),
  KEY `active` (`active`)
) ENGINE=MyISAM AUTO_INCREMENT=112 DEFAULT CHARSET=utf8 ROW_FORMAT=FIXED;

